          text: "#Invoice Id",

        },

        {

            dataField: "status",
            text: "status",


        },
        {

          dataField: "pdate",
          text: "Paid-Date",
       },
        {
            dataField: "Action",
            text: "Action",

          }
      ];
      const products=[
        {
          invoiceId:"#21347yt",
          status:<span className="badge badge-success">paid</span>,
          pdate:"2020-4-8",
          Action:Button(5)
        }
      ]


    return <>
             <TableCard 
             products={products}
             columns={columns}
              title={"PAYMENT HISTORY"}
             />
          </>

}

export default History;
